{
    render() { 
        return(
  <section>
    <div className="product">
      <div id="img-container">
      <img
        id = "tj"
        src="https://s3.amazonaws.com/cdn.matadornetwork.com/blogs/1/2019/02/Tijuana-street-lined-with-bars-and-shops-1200x853.jpg"
        alt="The cover of Stubborn Attachments"
